        static IEnumerable<TestCase<double, double>> GetTgammaRatioData(TgammaRatioData[] data)
        {
            return data.Select(d => TestCase.Create(d.A, d.B, d.Result));
        }

        static IEnumerable<TestCase<double, double>> GetDeltaRatioData(DeltaRatioData[] data)
        {
            var pos =  data.Select(d => TestCase.Create(d.X, d.Delta, d.Result));
            var neg =  data.Select(d => TestCase.Create(d.X, -d.Delta, d.NegResult));
            return pos.Union(neg);
        }

        /// <summary>
        ///A test for TgammaDeltaRatio
        ///</summary>
        [TestMethod()]
        public void TgammaDeltaRatioTest()
        {

            TestCaseSet<double, double>[] testCases = {
                new TestCaseSet<double,double>(GetDeltaRatioData(_TgammaDeltaRatioData), "Tgamma + Small delta ratios", 40),
                new TestCaseSet<double,double>(GetDeltaRatioData(_TgammaDeltaRatioInt), "Tgamma + small integer ratios", 40),
                new TestCaseSet<double,double>(GetDeltaRatioData(_TgammaDeltaRatioInt2), "Integer tgamma ratios", 40),
                new TestCaseSet<double,double>(_TgammaDeltaRatioTiny, "TgammaDeltaRatio: Tiny data", 700),

            };

            NumericFunctionTest.RunSet(Math2.TgammaDeltaRatio, "TgammaDeltaRatio", testCases);

        }

        /// <summary>
        ///A test for TgammaDeltaRatio
