        [TestMethod()]
        public void TgammaRatioTest()
        {

            TestCaseSet<double, double>[] testCases = {
                new TestCaseSet<double,double>(GetTgammaRatioData(tgamma_ratio_data), "TgammaRatio: Spot data", 20),
                new TestCaseSet<double,double>(GetTgammaRatioData(tgamma_ratio_data_mixed), "TgammaRatio: Spot Mixed data", 200),
                new TestCaseSet<double,double>(GetTgammaRatioData(tgamma_ratio_data_large_denorm), "TgammaRatio: Large denorm", 2100),
            };

            NumericFunctionTest.RunSet(Math2.TgammaRatio, "TgammaRatio", testCases);

        }
